import { Header, Slider } from "../../components";
import { Section ,NewRelease } from "../../components";
import { useSelector } from "react-redux";


const Home = () => {
  const { daily , chill ,artist, weekChart} = useSelector((state) => state.app);

  return (
    <div className="overflow-y-auto flex flex-col ">
      <Slider />
      <Section data = {chill}/>
      <NewRelease/>
      <Section data = {daily}/>
      <Section data = {artist}/>
      <div>
        {weekChart?.map(item => (
          <link to>
          </link>
        ))}
      </div>
    </div>
  );
};

export default Home;
